    "identifier": 3,
    "empiricalCompound": {
       "mass": 399.3367,
       "retentionTime": 18.8425
     },
     "theoreticalCompound": {
        "identifier": 32675,
        "name": "L-palmitoylcarnitine"
     },
     "adduct": "M+H"
}
~~~~
